  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Sabine NWR outlines
  Refuge accomplishments from May through July of 1941. The report begins by summarizing
  the weather conditions and water conditions during this period. Wildlife- including
  migratory birds, furbearers, and fish- is also covered. The Refuge development and
  maintenance section discusses physical developments. Resource management is outlined;
  topics include grazing and fur harvesting. A progress report on field investigations
  and applied research is also provided. The public relations section of the report
  describes Refuge visitors and violations. Photographs are attached.\",\n\t\"owner_org\":
